import { Fragment } from "react";
import Header from "./components/Header/Header";
import { createGlobalStyle } from 'styled-components';
import reset from "styled-reset";

const GlobalStyle = createGlobalStyle`
  ${reset}
`;

function App() {
  return (
    <Fragment>
      <GlobalStyle />
      <Header />
    </Fragment>
  );
}

export default App;
